A demo of WASM memory without wasm-bindgen based on the blog A practical guide to WebAssembly memory . wasm/memory/src/lib.rs /// https://radu-matei.com/blog/practical-guide-to-wasm-memory
/// Allocate memory into the module's linear memory
/// and return the offset to the start of the block.
#[no_mangle]
pub fn alloc(len: usize) -> *mut u8 { // create a new mutable buffer with capacity `len` let mut buf = Vec::with_capacity(len); // take a mutable pointer to the buffer let ptr = buf.as_mut_ptr(); // take ownership of the memory block and // ensure that its destructor is not // called when the object goes out of scope // at the end of the function std::mem::forget(buf); // return the pointer so the runtime // can write data at this offset return ptr;
} /// Given a pointer to the start of a byte array and
/// its length, return the sum of its elements.
#[no_mangle]
pub unsafe fn array_sum(ptr: *mut u8, len: usize) -> u8 { // create a Vec<u8> from the pointer to the // linear memory and the length let data = Vec::from_raw_parts(ptr, len, len); // actually compute the sum and return it data.iter().sum()
} fn main() { let array = [1, 2, 3, 4, 5]; let ptr = alloc(array.len()); println!("The length of the array {:?} is {}", array, array.len()); unsafe { println!("Copy the array into the memory block at {:?}", ptr); std::ptr::copy(array.as_ptr(), ptr, array.len()); println!("array_sum = {}", array_sum(ptr, array.len())); }
} wasm/memory/index.js function copyMemory(data, instance) { var ptr = instance.exports.alloc(data.length); var mem = new Uint8Array(instance.exports.memory.buffer, ptr, data.length); mem.set(new Uint8Array(data)); return ptr;
} function arraySum(array, instance) { var ptr = copyMemory(array, instance); var res = instance.exports.array_sum(ptr, array.length); return res;
} (async () => { var importObject = {}; const response = await fetch('wasm/memory/memory.wasm'); const bytes = await response.arrayBuffer(); const { instance } = await WebAssembly.instantiate(bytes, importObject); console.log({ response, bytes, instance }); document.getElementById('answer').innerHTML = ` <h2>arraySum([1, 2, 3, 4, 5], instance) = ${arraySum([1, 2, 3, 4, 5], instance)}</h2> See details in the console log. `
})();

